import React from 'react';

const Button = ({ children, tooltipText }) => {
  return (
    <div className="btn-cont flex justify-center items-center h-auto bg-[#1e1e1e] m-0 border border-white rounded-lg">
      <div className="tooltip tooltip-bottom" data-tip={tooltipText}>
        <button className="btn btn-ghost bg-transparent border-none cursor-pointer p-2.5 rounded relative transition-colors duration-200 ease-in">
          {children}
        </button>
      </div>
    </div>
  );
};

export default Button;
